    gdlr_core_sticky_sidebar.prototype = {
        init: function() {
            var t = this;
            t.elem.each(function() {
                $(this).find('.gdlr-core-pbf-sidebar-left, .gdlr-core-pbf-sidebar-right, .gdlr-core-sidebar-script').each(function() {
                    var sidebar_item = $(this);
                    var sidebar_wrap = sidebar_item.parent();
                    var sidebar_sub = $('<div></div>');
                    var prev_scroll = 0;
                    $(window).on('scroll resize', function(e) {
                        if (sidebar_item.outerHeight() >= sidebar_wrap.outerHeight()) {
                            t.return_sidebar_pos(sidebar_sub, sidebar_item);
                            return
                        }
                        if (gdlr_core_display != 'desktop') {
                            t.return_sidebar_pos(sidebar_sub, sidebar_item);
                            return
                        }
                        var scroll_pos = $(window).scrollTop();
                        var scroll_direction = (prev_scroll > scroll_pos) ? 'up' : 'down';
                        prev_scroll = scroll_pos;
                        if ($(window).height() > sidebar_item.height()) {
                            if (scroll_pos <= sidebar_wrap.offset().top) {
                                if (sidebar_item.hasClass('gdlr-core-fixed-sidebar') || sidebar_item.hasClass('gdlr-core-fixed-bottom-sidebar')) {
                                    t.return_sidebar_pos(sidebar_sub, sidebar_item)
                                }
                            } else {
                                if (scroll_pos + sidebar_item.outerHeight() >= sidebar_wrap.offset().top + sidebar_wrap.outerHeight()) {
                                    if (!sidebar_item.hasClass('gdlr-core-fixed-bottom-sidebar')) {
                                        t.set_sidebar_sub(sidebar_sub, sidebar_item);
                                        sidebar_item.addClass('gdlr-core-fixed-bottom-sidebar').removeClass('gdlr-core-fixed-sidebar');
                                        sidebar_item.css({
                                            'position': 'absolute',
                                            'top': 'auto',
                                            'bottom': 0,
                                            'left': sidebar_sub.position().left,
                                            'width': sidebar_sub.outerWidth()
                                        })
                                    }
                                } else {
                                    if (!sidebar_item.hasClass('gdlr-core-fixed-sidebar')) {
                                        t.set_sidebar_sub(sidebar_sub, sidebar_item);
                                        sidebar_item.addClass('gdlr-core-fixed-sidebar').removeClass('gdlr-core-fixed-bottom-sidebar');
                                        sidebar_item.css({
                                            'position': 'fixed',
                                            'top': 0,
                                            'bottom': 'auto',
                                            'width': sidebar_sub.outerWidth()
                                        });
                                        sidebar_item.css({
                                            'left': sidebar_sub.offset().left,
                                        })
                                    }
                                }
                                if (e.type == 'resize') {
                                    if (sidebar_item.hasClass('gdlr-core-fixed-bottom-sidebar')) {
                                        sidebar_item.css({
                                            'width': sidebar_sub.outerWidth(),
                                            'left': sidebar_sub.position().left,
                                        })
                                    } else if (sidebar_item.hasClass('gdlr-core-fixed-sidebar')) {
                                        sidebar_item.css({
                                            'width': sidebar_sub.outerWidth(),
                                            'left': sidebar_sub.offset().left,
                                        })
                                    }
                                }
                            }
                        } else {
                            if (scroll_pos <= sidebar_wrap.offset().top) {
                                if (sidebar_item.hasClass('gdlr-core-fixed-bottom-sidebar') || sidebar_item.hasClass('gdlr-core-stick-bottom-sidebar') || sidebar_item.hasClass('gdlr-core-fixed-top-sidebar') || sidebar_item.hasClass('gdlr-core-stick-top-sidebar')) {
                                    t.return_sidebar_pos(sidebar_sub, sidebar_item)
                                }
                            } else {
                                if (scroll_direction == 'down') {
                                    if (sidebar_item.hasClass('gdlr-core-fixed-top-sidebar')) {
                                        t.set_sidebar_sub(sidebar_sub, sidebar_item);
                                        sidebar_item.addClass('gdlr-core-stick-top-sidebar').removeClass('gdlr-core-fixed-bottom-sidebar gdlr-core-fixed-top-sidebar gdlr-core-stick-bottom-sidebar');
                                        sidebar_item.css({
                                            'position': 'absolute',
                                            'top': scroll_pos - sidebar_wrap.offset().top,
                                            'bottom': 'auto',
                                            'left': sidebar_sub.position().left,
                                            'width': sidebar_sub.outerWidth()
                                        })
                                    } else if (scroll_pos + $(window).height() >= sidebar_wrap.offset().top + sidebar_wrap.outerHeight()) {
                                        t.set_sidebar_sub(sidebar_sub, sidebar_item);
                                        sidebar_item.addClass('gdlr-core-stick-bottom-sidebar').removeClass('gdlr-core-fixed-bottom-sidebar gdlr-core-fixed-top-sidebar gdlr-core-stick-top-sidebar');
                                        sidebar_item.css({
                                            'position': 'absolute',
                                            'top': 'auto',
                                            'bottom': 0,
                                            'left': sidebar_sub.position().left,
                                            'width': sidebar_sub.outerWidth()
                                        })
                                    } else if (scroll_pos + $(window).height() > sidebar_item.offset().top + sidebar_item.outerHeight()) {
                                        t.set_sidebar_sub(sidebar_sub, sidebar_item);
                                        sidebar_item.addClass('gdlr-core-fixed-bottom-sidebar').removeClass('gdlr-core-stick-bottom-sidebar gdlr-core-stick-top-sidebar gdlr-core-fixed-top-sidebar');
                                        sidebar_item.css({
                                            'position': 'fixed',
                                            'top': 'auto',
                                            'bottom': '0',
                                            'left': sidebar_sub.offset().left,
                                            'width': sidebar_sub.outerWidth()
                                        })
                                    }
                                } else {
                                    if (sidebar_item.hasClass('gdlr-core-fixed-bottom-sidebar')) {
                                        t.set_sidebar_sub(sidebar_sub, sidebar_item);
                                        sidebar_item.addClass('gdlr-core-stick-bottom-sidebar').removeClass('gdlr-core-fixed-bottom-sidebar gdlr-core-fixed-top-sidebar gdlr-core-stick-top-sidebar');
                                        sidebar_item.css({
                                            'position': 'absolute',
                                            'top': scroll_pos + $(window).height() - sidebar_item.outerHeight() - sidebar_wrap.offset().top,
                                            'bottom': 'auto',
                                            'left': sidebar_sub.position().left,
                                            'width': sidebar_sub.outerWidth()
                                        })
                                    } else {
                                        if (scroll_pos < sidebar_item.offset().top) {
                                            t.set_sidebar_sub(sidebar_sub, sidebar_item);
                                            sidebar_item.addClass('gdlr-core-fixed-top-sidebar').removeClass('gdlr-core-stick-bottom-sidebar gdlr-core-fixed-bottom-sidebar gdlr-core-stick-top-sidebar');
                                            sidebar_item.css({
                                                'position': 'fixed',
                                                'top': '0',
                                                'bottom': 'auto',
                                                'left': sidebar_sub.offset().left,
                                                'width': sidebar_sub.outerWidth()
                                            })
                                        }
                                    }
                                }
                                if (e.type == 'resize') {
                                    if (sidebar_item.hasClass('gdlr-core-stick-bottom-sidebar') || sidebar_item.hasClass('gdlr-core-stick-top-sidebar')) {
                                        sidebar_item.css({
                                            'width': sidebar_sub.outerWidth(),
                                            'left': sidebar_sub.position().left,
                                        })
                                    } else if (sidebar_item.hasClass('gdlr-core-fixed-bottom-sidebar') || sidebar_item.hasClass('gdlr-core-fixed-top-sidebar')) {
                                        sidebar_item.css({
                                            'width': sidebar_sub.outerWidth(),
                                            'left': sidebar_sub.offset().left,
                                        })
                                    }
                                }
                            }
                        }
                    })
                })
            })
        },
        set_sidebar_sub: function(sidebar_sub, sidebar_item) {
            if (sidebar_item.hasClass('gdlr-core-sidebar-sub-added'))
                return;
            var sidebar_class = '';
            sidebar_item.each(function() {
                var className = this.className.match(/gdlr-core-column-\d+/);
                if (className) {
                    sidebar_class = className[0]
                }
            });
            sidebar_sub.addClass(sidebar_class);
            sidebar_sub.css({
                'float': sidebar_item.css('float'),
                'height': 20,
                'background': '#fd9'
            });
            sidebar_sub.insertAfter(sidebar_item);
            sidebar_item.addClass('gdlr-core-sidebar-sub-added')
        },
        return_sidebar_pos: function(sidebar_sub, sidebar_item) {
            sidebar_item.css({
                'position': '',
                'top': '',
                'bottom': '',
                'left': '',
                'width': '',
                'height': ''
            });
            sidebar_item.removeClass('gdlr-core-fixed-sidebar gdlr-core-fixed-bottom-sidebar gdlr-core-sidebar-sub-added');
            sidebar_item.removeClass('gdlr-core-stick-bottom-sidebar gdlr-core-fixed-bottom-sidebar gdlr-core-fixed-top-sidebar');
            sidebar_sub.remove()
        }
    }
    $.fn.gdlr_core_isotope = function(filter_elem) {
        if (typeof ($.fn.isotope) == 'function') {
            if (typeof (filter_elem) == 'undefined') {
                var elem = $(this).find('[data-layout="masonry"]')
            } else {
                var elem = filter_elem.filter('[data-layout="masonry"]')
            }
            elem.each(function() {
                var t = $(this);
                if (t.children('ul.products').length) {
                    t = t.children('ul.products')
                }
                var columnSize = t.width() / 60;
                t.isotope({
                    itemSelector: '.gdlr-core-item-list',
                    layoutMode: 'masonry',
                    masonry: {
                        columnWidth: columnSize
                    }
                });
                t.isotope();
                t.children('.gdlr-core-item-list').gdlr_core_animate_list_item();
                $(window).on('resize gdlr-core-element-resize', function() {
                    columnSize = t.width() / 60;
                    t.isotope({
                        masonry: {
                            columnWidth: columnSize
                        }
                    })
                })
            })
        }
        return $(this)
    }
    $.fn.gdlr_core_animate_list_item = function() {
        var ux_items = $(this).get();
        var ux_interval = setInterval(function() {
            if (ux_items.length > 0) {
                var ux_animate = $(ux_items.shift());
                var animation_duration = '600ms';
                ux_animate.css({
                    'animation-duration': animation_duration
                });
                ux_animate.addClass('gdlr-core-animate');
                setTimeout(function() {
                    ux_animate.css({
                        'animation-duration': ''
                    }).addClass('gdlr-core-animate-end').removeClass('gdlr-core-animate gdlr-core-animate-init')
                }, parseInt(animation_duration))
            } else {
                clearInterval(ux_interval)
            }
        }, 200)
    }
